import React, { Component } from "react";


class MaterialList extends Component {
  constructor() {
    super();
    this.state = { data: [] };
  }

  async componentDidMount() {
    try {
      const response = await fetch(`https://api.coinmarketcap.com/v1/ticker/?limit=10`, {mode: 'no-cors'});
      const json = await response.json();
      console.log(json);
    } catch (error) {
      console.log(error);
    }    
  }

  render() {
    return (
      <div>Materials in here</div>
    )
  }
}

export default MaterialList;
